import React from 'react';
import MenuCard from './components/MenuCard';

function App() {
  return (
    <div className="min-h-screen bg-gray-100 py-8">
      <div className="max-w-6xl mx-auto px-4">
        <MenuCard />
      </div>
    </div>
  );
}

const { jsPDF } = window.jspdf;

function generatePDF() {
    const doc = new jsPDF();

    // Add title and images/text based on your layout
    doc.text("Choi Family Home Dining", 10, 10);
    doc.text("Korean", 10, 20);

    // Add more text and images by iterating over menu items
    doc.save("menu.pdf");
}


export default App;
